import React from 'react';
import Card from './Card';

const data = [
	{
		depart: 'Krakow',
		arrive: 'Paris',
		departureDate: '23.11',
		returnDate: '23.11',
		stops: 0,
		airlines: 'Ryanair',
		price: '123,00',
	},
	{
		depart: 'Krakow',
		arrive: 'Paris',
		departureDate: '23.11',
		returnDate: '23.11',
		stops: 0,
		airlines: 'Ryanair',
		price: '123,00',
	},
	{
		depart: 'Krakow',
		arrive: 'Paris',
		departureDate: '23.11.2024',
		returnDate: '23.11.2024',
		stops: 0,
		airlines: 'Ryanair',
		price: '123,00',
	},
];

function FlightsViewer() {
	return (
		<div className="flex justify-content-center">
			<div className="grid grid-cols-4 auto-rows-fr p-3 w-3/4 gap-3">
				{data.map((elem) => (
					<Card data={elem} />
				))}
			</div>
		</div>
	);
}

export default FlightsViewer;
